export class StepModel {
  constructor(stepIndex, title, active = true, canEnter = true, canGoNext = true, canGoPrev = true, nextStepId = 0, prevStepId = 0, touched = false, position_x = '0px', position_y = '80px', isComplete = false) {
    this.stepIndex = stepIndex;
    this.title = title;
    this.active = active;
    this.canEnter = canEnter;
    this.canGoNext = canGoNext;
    this.canGoPrev = canGoPrev;
    this.nextStepId = nextStepId;
    this.prevStepId = prevStepId;
    this.touched = touched;
    this.position_x = position_x;
    this.position_y = position_y;
    this.isComplete = isComplete;
  }

}
